    {
      own: false,
      padding: "20px 0",
    },
    {
      own: true,
      padding: "40px 0",
    },
    {
      own: false,
      padding: "20px 0",
    },
    {
      own: false,
      padding: "40px 0",
    },
    {
      own: true,
      padding: "20px 0",
    },
    {
      own: false,
      padding: "20px 0",
    },
  ];
  return (
    <>
      {[...Array(6)].map((item, i) => (
        <div key={i} className="chat-message-wrapper-skeleton">
          <div className="chat-message-PP-skeleton" />
          <div className="chat-message-skeleton"></div>
        </div>
      ))}
    </>
  );
};

export default ChatMessagesSkeleton;
